window.bookSummaryJSON = "<p>Increasing powers, incredible responsibility, and one off-balance girl. </p> <p>Having the power of three elemental artifacts has unbalanced my powers. The only solution is to find the fourth one to make me whole, before I implode and destroy everything around me.</p> <p>Unfortunately for me, I’m not the only one after that artifact. There’s an entire list of supernaturals waiting for the right moment to take it for themselves. And they’ll stop at nothing to make that happen. Even if that means taking my life.</p> <p>Not knowing who to trust, I head with my friends to the realm, but as intentions of my fellow travelers are revealed, heartbreak becomes inevitable. </p> <p>The question is whether I’ll be left standing when everything is said and done.</p>"; 
